function getNumberOfWeek() {
   /* const today = new Date();
    const firstDayOfYear = new Date(today.getFullYear(), 0, 1);
    const pastDaysOfYear = (today - firstDayOfYear) / 86400000;
    return Math.ceil((pastDaysOfYear + firstDayOfYear.getDay() + 1) / 7)-2;
*/
    const maDate = new Date()
    var d = new Date(maDate.getFullYear(), maDate.getMonth(), maDate.getDate(), 0, 0, 0);
    var DoW = d.getDay();
    d.setDate(d.getDate() - (DoW + 6) % 7 + 3); // Nearest Thu
    var ms = d.valueOf(); // GMT
    d.setMonth(0);
    d.setDate(4); // Thu in Week 1
    return Math.round((ms - d.valueOf()) / (7 * 864e5)) + 1;
}

function buildPuzzlesQuotidien() {
    var weekNumMax=0;
    var filter="";
    var dateNow = new Date();
    var currentWeekNumber=getNumberOfWeek();
    for (var i = 0; i < puzzlesQuotidien.puzzles.length; i++) {
        filter=puzzlesQuotidien.puzzles[i].filter;
        if(filter.length==0 || (filter>currentWeekNumber && (filter-currentWeekNumber)<49)){
            console.log(i+" Escape Filter '"+filter+"' puzzleTitle="+puzzlesQuotidien.puzzles[i].puzzleTitle);
            continue;
        }
        //console.log("Filter '"+filter+"' puzzleTitle="+puzzlesQuotidien.puzzles[i].puzzleTitle);
        if(filter>weekNumMax){
            weekNumMax=filter;
        }
    }
    console.log("weekNumMax="+weekNumMax);
    var puzzlesArray = puzzlesShortQuotidien.puzzles;
    var numDay = dateNow.getDay();
    var weekday = new Array(7);
    weekday[0] = "Sunday";//Dimanche
    weekday[1] = "Monday";//Lundi
    weekday[2] = "Tuesday";//Mardi
    weekday[3] = "Wednesday";//Mercredi
    weekday[4] = "Thursday";//Jeudi
    weekday[5] = "Friday";//Vendredi
    weekday[6] = "Saturday";//Samedi

    //numDay=2;//Test
    console.log("numDay="+numDay +" -> "+ weekday[numDay]);
    for (var i = 0; i < openningsPuzzles.puzzles.length; i++) {
        filter=openningsPuzzles.puzzles[i].filter;
        //console.log("Filter opennings '"+filter+"' puzzleTitle="+openningsPuzzles.puzzles[i].puzzleTitle);
        if(filter==numDay){
            puzzlesArray.push(openningsPuzzles.puzzles[i]);
        }
    }

    console.log("Add "+(puzzlesArray.length-puzzlesShortQuotidien.puzzles.length)+" openning puzzles");
    puzzlesShortQuotidien.puzzles=puzzlesArray;

}

